import { BrowserRouter as Router, Route } from 'react-router-dom';

import Footer from './components/Footer/Footer.js';
import WelcomePage from './pages/WelcomePage/WelcomePage';


function App() {
  return (
    <div className="App">
      <Router>
        {/* <Route path="/welcome" exact>
          <WelcomePage />
        </Route> */}
        <Route path="/" exact>
          <Footer />
        </Route>
      </Router>
    </div>
  );
}

export default App;
